  "text" : "でも、津波を河川の洪水流で置き換えて（問題ないかちょっと分からないけど、類似性はあるのでとりあえず）考えてみても、ブロックの切れ目が流速なり波高を大きくするとは考えられんもんなー。 #tsunami",
