  "text" : "でも、自分が面白い/興味あると思ったふぉろいんぐの人の発言を見てみたいというふぉろわーさんもいるかもしれないので、そういう人のためにRT専用のアカウントを作っとくのはありかなぁと思い至ったわけです。こと、ここ最近の「Twitterを情報共有ツールとして使う」人たちに向けると。",
