  "text" : "でも、最近の流れとして、政治が社会保障の充実を目指してたので、土木業界は削られる予算でどうにかやりくりしようって流れだったと思います。こういう言い方もあれですが、この震災を期に少しはそんな状況が改善されないかなと期待しているところです。",
