  "text" : "だって7章とかちらっと読んだんですが基本的に金属の話ばっかりでしたし！と思ってましたが、目次を見てみたら、10章の「弾性-脆性損傷」にコンクリートの話が出てた！ちょっとここはあとで読む（今日の夜とか。",
