  "in_reply_to_user_id" : 38087090,
  "text" : "@commonko でも「限界がある」と言いつつ、この本は損傷変数がどうなるかっていう話が基本に進んでくので、多分一応はこれでいいんじゃないかって思いましたｗ。",
