  "geo" : {
  },
  "id_str" : "46828466976464896",
  "text" : "いま気づいたけど、味噌煮の鍋をコンロの上に置きっぱなし。冷蔵庫入れ忘れた。悪くなってなきゃいいけど（最後に火をいれたのは昨日の朝、でかける前。",
