  "geo" : {
  },
  "id_str" : "46827825428307968",
  "text" : "とりあえず言いたいことは、チェンメとか拡散希望とか滅びよということです。これらを排除できた世界は、いまよりすごく素晴らしいものになってると切に思う。",
