  "geo" : {
  },
  "id_str" : "46709367550115841",
  "text" : "昨日言いたかったこと：自分がその道のプロだと信じていて、有益な情報発信や考察ができると思ってる人は、どんどんしてくださったほうがいい。けど、「何の役にも立たないけど情報を広めるぐらいなら・・・！」って非力な人たちは、ノイズになっている可能性が極めて高いことに留意して。 [n]",
  "id" : 46709367550115841,
  "created_at" : "Sat Mar 12 23:09:15 +0000 2011",
