  "geo" : {
  },
  "id_str" : "46337800261480448",
  "text" : "とりあえず、こんな状況で #jawp に地震のことを競って書きたがる人たちは何を思ってるのか全く理解できない。平常時の「信頼できる情報源」が誤報を出す可能性が高いのに、彼らは何を持って信頼できる記述を書いてるのか。超能力者たちなんですかねぇ。",
  "id" : 46337800261480448,
  "created_at" : "Fri Mar 11 22:32:47 +0000 2011",
