  "id_str" : "46171823032909826",
  "text" : "本当に必要な情報なら、自分が広めなくても、必要な人にその情報はきちんと届く。そういうシステムがちゃんと作られているのだから。自分のような一市民が動かなきゃいけないような情報なら、それはほとんどの場合、必要性は低いこと。そういう認識でいようと改めて思いました。",
