  "text" : "今のところ大体、知り合いの安全は確認できた。けど、あと1人、水戸の人がいたんだった。大洗とか海浜公園とか一緒にあそびにいった場所があぁいう映像流れてると心配だな・・・。とはいうものの、連絡先が分からないので、連絡しようがないんですが。",
