  "text" : "阪神淡路大震災の時に3時間後がどうこうという話が流れてきてるけど、そんなことは別にどうでも良い。重要なのは、まだ大きいエネルギーの地震がつづいているってことで、つまりまだこの先大きな揺れが起きる可能性が十分にあるっていうこと。気を緩めない。",
