  "id_str" : "44802502587199488",
  "text" : "中学校の時の高校見学で、普通科のやってることが中学校の延長みたいな感じで、将来やりたいこと（興味があること）が決まってた自分にとって、そういうのはつまらなく感じるだろうと思った。これが高専に行った理由です。",
