  "text" : "なんとなく分かった。M1の12月までに土木技術検定試験を受けて合格したら、M1の2月ごろに交付申請書類が届くから、M2になって実務経験1年ってなったら、「２級土木技術者資格認定証」をもらえるということっぽい。たぶん。",
